import React, { Component } from 'react';
import { Card, Switch } from 'antd';
import 'antd/dist/antd.css';

export class App extends Component {
  state = {
    denomination: false
  }

  onChange = (value) => {
    this.setState({denomination: value});
    console.log(value);
  }

  render() {
    return (
      <Card title="ATM Machine" style={{ width: 300, textAlign: "center", margin: "auto" }}>
        <Switch onChange={this.onChange} unCheckedChildren="Denomination" checkedChildren="Denomination"/>
      </Card>
    )
  }
}

export default App
